import React, { Component } from 'react';

class Edu extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <section>
            <div>
            <div className="serviceheader">
                    <h1 className="text-center" id="servicehead"> Education</h1>
                    <div className="underline text-center"></div>
                </div>
                </div>
                </section>
        );
    }
}



export default Edu;
